        .k-corner,
        .kk-corner,
        .kofi-corner,
        .storybook-corner,
        .github-corner {
            position: fixed;
            right: 0;
            cursor: pointer;
            z-index: 999;
        }

            top: 210px;
        }

            font-family: 'Yoyo Three BC';
            top: 290px;

            top: 370px;

            top: 120px;
        }

            top: 0;
        }

        .kofi-corner .storybook-icon {
            width: 60px;
            height: auto;
        }

        .storybook-corner .storybook-icon {
            width: 50px;
            height: auto;
        }

        .github-corner:hover .octo-arm {
            animation: octocat-wave 560ms ease-in-out
        }

        @keyframes octocat-wave {

            0%,
            100% {
                transform: rotate(0)
            }

            20%,
            60% {
                transform: rotate(-25deg)
            }

            40%,
            80% {
                transform: rotate(10deg)
            }
        }

        @media (max-width:500px) {
            .github-corner:hover .octo-arm {
                animation: none
            }

            .github-corner .octo-arm {
                animation: octocat-wave 560ms ease-in-out
            }
        }
